  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Madison
  Wetland Management District outlines District accomplishments during the 1981 calendar
  year. The report begins by describing the climate and habitat conditions in the
  District, as well as the land acquisition program and system status. The construction
  and maintenance section describes physical developments, maintenance, and wildfires.
  The habitat management section discusses croplands, grasslands, haying, prescribed
  fire, vegetation control, wetlands, forestlands, and easements for waterfowl management.
  Wildlife- including endangered and threatened species, migratory birds, big game
  animals, and raptors- are discussed. The public relations sections describes information
  and recreation, recreational uses, and enforcement. Field investigations, cooperative
  programs, and items of interest are discussed. Photographs are attached.\",\n\t\"owner_org\":
